//package TreePackage;import java.util.Iterator;import java.util.NoSuchElementException;import java.util.Stack ; // for Stackpublic class BinaryTree<T>{    protected BinaryNodeLab9<T> root;        public BinaryTree() {	     root = null;    } // end default constructor        public BinaryTree(T rootData) {	     root = new BinaryNodeLab9<T>(rootData);    } // end constructor   public BinaryTree(T rootData, BinaryTree<T> leftTree,                                  BinaryTree<T> rightTree) {       privateSetTree(rootData, leftTree, rightTree);   } // end constructor   public int count1(T anObject) {	   return count1(root, anObject);   }      private int count1(BinaryNodeLab9<T> rootNode, T anObject) {	   return -1;   }      public int count2(T anObject) {	   return -1;   }      public boolean isIsomorphic(BinaryTree<T> otherTree) {	   return false;   }   //   public ExpressionTree(String infix) {//	   //   }//   //   private ExpressionTreeInterface formTree(String expr, int first, int last) {//	   //   }      public void setTree(T rootData)   {      root = new BinaryNodeLab9<T>(rootData);   } // end setTree      public void setTree(T rootData, BinaryTree<T> leftTree,		       BinaryTree<T> rightTree)   {      privateSetTree(rootData, leftTree, rightTree);   } // end setTree   private void privateSetTree(T rootData, BinaryTree<T> leftTree,                                           BinaryTree<T> rightTree)   {          root = new BinaryNodeLab9<T>(rootData);      if (leftTree != null)	       root.setLeftChild(leftTree.root);               if (rightTree != null)         root.setRightChild(rightTree.root);   }    public T getRootData () {        T rootData = null;        if (root != null)            rootData = root.getData();        return rootData;   }   public boolean isEmpty () {       return root == null;   }   public void clear (){       root = null;   }   // getHeight and getNumberOfNodes call same functions in BinaryNode<T>   public int getHeight () {       return root.getHeight ();   }    public int getNumberOfNodes () {       return root.getNumberOfNodes ();   }      public void inorderTraversal() {       Stack<BinaryNodeLab9<T>> nodeStack = new Stack<BinaryNodeLab9<T>>();       BinaryNodeLab9<T> currentNode = root;              while (!nodeStack.empty() || currentNode != null) {      	   while(currentNode != null) {      	       nodeStack.push(currentNode);      	       currentNode = currentNode.getLeftChild();      	   }      	   if(!nodeStack.empty()) {      	       BinaryNodeLab9<T> nextNode = nodeStack.pop();      	       System.out.println(nextNode.getData());      	       currentNode = nextNode.getRightChild();      	   }       }   }      public Iterator<T> getPreorderIterator() {       return new PreorderIterator();   }      public Iterator<T> getInorderIterator() {       return new InorderIterator();   }      private class PreorderIterator implements Iterator<T> {       private Stack<BinaryNodeLab9<T>> nodeStack;              public PreorderIterator() {	   nodeStack = new Stack<BinaryNodeLab9<T>>();	   if (root != null)	       nodeStack.push(root);       } // end default constructor              public boolean hasNext()  {	   return !nodeStack.isEmpty();       } // end hasNext              public T next() {	   BinaryNodeLab9<T> nextNode;	   	   if (hasNext()) {	       nextNode = nodeStack.pop();	       BinaryNodeLab9<T> leftChild = nextNode.getLeftChild();	       BinaryNodeLab9<T> rightChild = nextNode.getRightChild();	       	       // push into stack in reverse order of recursive calls	       if (rightChild != null)		   nodeStack.push(rightChild);	       	       if (leftChild != null)		   nodeStack.push(leftChild);	   }	   else {	       throw new NoSuchElementException();	   }	   return nextNode.getData();       } // end next              public void remove() {	   throw new UnsupportedOperationException();       } // end remove   } // end PreorderIterator       private class InorderIterator implements Iterator < T >   {       private Stack< BinaryNodeLab9 < T >> nodeStack;       private BinaryNodeLab9< T > currentNode;       public InorderIterator () {	   nodeStack = new Stack < BinaryNodeLab9< T >> ();	   currentNode = root;       } // end default constructor       public boolean hasNext () {	   return !nodeStack.isEmpty () || (currentNode != null);       } // end hasNext       public T next ()       {	   BinaryNodeLab9< T > nextNode = null;	   // find leftmost node with no left child	   while (currentNode != null) {	       nodeStack.push (currentNode);	       currentNode = currentNode.getLeftChild ();	   } // end while	   // get leftmost node, then move to its right subtree	   if (!nodeStack.isEmpty ()) {	       nextNode = nodeStack.pop ();	       currentNode = nextNode.getRightChild ();	   }	   else	       throw new NoSuchElementException ();	   return nextNode.getData ();       } // end next                     public void remove () {	   throw new UnsupportedOperationException ();       } // end remove   } // end InorderIterator   } // end BinaryTree